import React from 'react'
import styled from 'styled-components'

function SideBar() {
  return (
    <Container>
        <nav>
            <ul>
                <li>Health & Beauty</li>
                <li>Health & Beauty</li>
                <li>Health & Beauty</li>
                <li>Health & Beauty</li>
                <li>Health & Beauty</li>
            </ul>
        </nav>
    </Container>
  )
}

const Container=styled.div`
    width:100%;
    flex:0.15;
    background: #fff;
    border-radius: 10px;
    margin: 19px 18px 0 18px;
    height: fit-content;
    flex:0.2;

    nav{
        ul{
            list-style: none;
            text-decoration: none;
            box-sizing: border-box;
        }
    }
`;
export default SideBar
